import { useGlobalContext } from "./context";
import { Component } from "react";
const allComponents = () => {
  const { addTask } = useGlobalContext();
  return (
    <section>
      <table>
        <tr>
          <td>to do</td>
          <td>doing</td>
          <td>done</td>
        </tr>
        <Component />
      </table>
    </section>
  );
};

export default allComponents;
